import React ,{Component} from 'react';

import Count from './container/Count'

import store from './redux/store'

import { Provider } from 'react-redux';

class App extends Component {
	render() {
		return (
			<div>
				<Provider store={store}>
				<Count />
				</Provider>

			</div>
		);
	}
}

export default App;
